import './App.css';
import ListComponent from './components/ListComponent';
import { useState } from 'react';

function App() {

  const [listItem, setListItem] = useState(initialListItems);

  return (
    <div className="App">
      <ListComponent listItem={listItem} setListItem={setListItem}/>
    </div>
  );
}

export default App;
